                             "collectionViewUrl": "https://books.apple.com/us/audiobook/me/id1478969801?uo=4",
                             "artworkUrl60": "https://is1-ssl.mzstatic.com/image/thumb/Music123/v4/0f/a8/bd/0fa8bd48-ff72-eb9a-27d8-dc302c9b3894/9781250231062.jpg/60x60bb.jpg",
                             "artworkUrl100": "https://is1-ssl.mzstatic.com/image/thumb/Music123/v4/0f/a8/bd/0fa8bd48-ff72-eb9a-27d8-dc302c9b3894/9781250231062.jpg/100x100bb.jpg",
                             "collectionPrice": 16.99,
                             "collectionExplicitness": "notExplicit",
                             "trackCount": 1,
                             "country": "USA",
                             "currency": "USD",
                             "releaseDate": "2019-10-15T07:00:00Z",
                             "primaryGenreName": "Biographies & Memoirs",
                             "previewUrl": "https://audio-ssl.itunes.apple.com/itunes-assets/AudioPreview113/v4/f9/1c/8c/f91c8ccc-d06f-06e3-94ad-6c20d6f3aa0c/mzaf_9829918968424896041.std.aac.p.m4a",
                             "description": "<b>In his first and only official autobiography, music icon Elton John reveals the truth about his extraordinary life, from his rollercoaster lifestyle as shown in the film <i>Rocketman<\/i>, to becoming a living legend.<\/b><br /><br />Christened Reginald Dwight, he was a shy boy with Buddy Holly glasses who grew up in the London suburb of Pinner and dreamed of becoming a pop star. By the age of twenty-three he was performing his first gig in America, facing an astonished audience in his bright yellow dungarees, a star-spangled T-shirt, and boots with wings. Elton John had arrived and the music world would never be the same again.<br /><br />His life has been full of drama, from the early rejection of his work with song-writing partner Bernie Taupin to spinning out of control as a chart-topping superstar; from half-heartedly trying to drown himself in his LA swimming pool to disco-dancing with Princess Diana and Queen Elizabeth; from friendships with John Lennon, Freddie Mercury, and George Michael to setting up his AIDS Foundation to conquering Broadway with <i>Aida<\/i>, <i>The Lion King<\/i>, and <i>Billy Elliot the Musical<\/i>. All the while Elton was hiding a drug addiction that would grip him for over a decade.<br /><br />In <i>Me<\/i>, Elton also writes powerfully about getting clean and changing his life, about finding love with David Furnish and becoming a father. In a voice that is warm, humble, and open, this is Elton on his music and his relationships, his passions and his mistakes. This is a story that will stay with you by a living legend."
                         },
