                             "description": "Today on O&amp;A, we start today’s show talking about MSNBC’s morning show. We talk about some Joe Scarborough controversy and talk about people who benefitted from 9/11. We talk about the Anne Romney controversy and Friday the 13th.<br /><br />We bring up the Francis Bean Cobain and Dave Grohl accusations. Joe DeRosa stops by and tells us about moving back to Philly. We talk about Bruce Springsteen as well as how terrible Billy Joel and Elton John are. Joe DeRosa talks about showering with a guy and we talk about his tranny affection. Ricky Gervais stops by to talk about his new show on HBO.<br /><br />Finally, Sam hosts After O&amp;A Live, where he talks to Opie, then plays Carly Rae Jepsen some more. [Broadcast Date: April 13, 2012]<br /><br /><b>Explicit Language Warning: You must be 18 years or older to purchase this program.<\/b>"
