                             "description": "Er ist Musikgenie, Paradiesvogel und einer der erfolgreichsten Künstler aller Zeiten. \"Your Song\", \"Tiny Dancer\" und \"Candle in the Wind\" sind nur einige von unzähligen Hits seiner beispiellosen Karriere. Erstmals erzählt Pop-Legende Elton John jetzt die Geschichte seines wechselhaften Lebens. \r\nVon seinen Anfängen als Musikstudent und seinem Coming-out, vom Höhepunkt seiner Karriere in den 70ern, von seiner Freundschaft zu John Lennon und Prinzessin Diana, von seiner jahrelangen Drogensucht und vom lang ersehnten persönlichen Glück – schonungslos offen blickt Sir Elton John zurück auf ein halbes Jahrhundert Musikgeschichte."
