                             "primaryGenreName": "Biographies & Memoirs",
                             "previewUrl": "https://audio-ssl.itunes.apple.com/itunes-assets/AudioPreview123/v4/28/45/2d/28452d42-78d0-ea23-b905-c062462a0ce6/mzaf_10304419517522689578.std.aac.p.m4a",
                             "description": "Elton John is as much loved for his outrageous personality and witty outspokenness as for his music. Such shamelessness and sheer silliness rivals anything uttered by punk rockers, yet it is so typically Elton: honest and intemperate. Tragedy and heartbreak have played a large part in his life. Behind the parties, the hedonism, the lavish stage costumes, and silly glasses lies a more somber story. Between disputes with managers, legal wranglings, public break-ups, and divorce, John has been faced with not only an expanding waistline and a receding hairline, but serious health problems and drug addictions. Drawing on many firsthand interviews with his associates and musical collaborators, this intriguing story of high drama and prodigious talent traces John's astonishing journey through life as the colossus of camp, while also offering a critical history of his work and a fresh analysis of his contributions to popular music."
